import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import PropsTypes from 'prop-types';
import {connect} from 'react-redux';
import {logOut} from '../actions/authAction';
import { clearCurrentProfile  } from '../actions/profileActions';
class Navbar extends Component {

  onLongOutClick(e) {
    e.preventDefault();
    this.props.clearCurrentProfile();
    this.props.logOut();
  }
    render() {
    const {isAuthenticated, user} =this.props.auth;

          const authLinks =(
               <ul class="navbar-nav ml-auto">
                 <li class="nav-item">
                  <Link class="nav-link" to="/login">Login</Link>
                </li>
                  <li class="nav-item">
                    <a class="nav-link" onClick={this.onLongOutClick.bind(this)} href="">
                      <img className="rounded-circle" src={user.avatar} style={{width:"25px",height:"25px",marginRight:'5px'}} alt={user.name}/>
                      Logout
                      </a>
                  </li>
                </ul>
    )
    const guessLinks =(
      <ul class="navbar-nav ml-auto">
         <li class="nav-item">
           <Link class="nav-link" to="/register">Sign Up</Link>
         </li>
         <li class="nav-item">
           <Link class="nav-link" to="/login">Login</Link>
         </li>
       </ul>
)
        return (
            <nav class="navbar navbar-expand-sm navbar-dark bg-dark mb-4">
            <div class="container">
              <Link class="navbar-brand" to="/">DevConnector</Link>
              <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#mobile-nav">
                <span class="navbar-toggler-icon"></span>
              </button>
        
              <div class="collapse navbar-collapse" id="mobile-nav">
                <ul class="navbar-nav mr-auto">
                  <li class="nav-item">
                    <Link class="nav-link" to=""> Developers
                    </Link>
                  </li>
                </ul>
        
                {isAuthenticated ? authLinks :guessLinks}
              </div>
            </div>
          </nav>
        
        )
    }
}

Navbar.PropsTypes ={
  logoutUser:PropsTypes.func.isRequired,
  auth:PropsTypes.object.isRequired
}

const mapStateToProps =(state) => ({
  auth:state.auth
})


export default connect(mapStateToProps,{logOut,clearCurrentProfile})(Navbar);
